import React, { Component } from 'react';
import * as actions from '../store/actions.js'

class Task extends Component {

    render() {
        var task = this.props.task
        return (
            <div>
                <label>Task:</label>
                <p>{task.text}</p>
                <label>Assigned:</label>
                <p>{actions.getEngineersName(task.personID)}</p>
            </div>
        );
    }
}

export default Task;
